import React from "react"

function Heading(){
    return <div className="heading">
    <h1>To-Do List</h1>
  </div>
}

let checked = false

function Listitem(props){

  const [count, setCount] = React.useState(<li onClick={isChecked}>{props.text}</li>)

  function isChecked(){
    if (checked === true){
      checked = false
      setCount(<li onClick={isChecked}>{props.text}</li>)
    }else{
      checked = true
      setCount(<li style={{"textDecoration": "line-through"}} onClick={isChecked}>{props.text}</li>)
    }
  }
}


export {Heading, Listitem}
